function draw_box(x,y,w,h,a)
 local ca=math.cos(a)
 local sa=math.sin(a)
 local wx=w/2*ca
 local wy=w/2*sa
 local hx=-h/2*sa
 local hy=h/2*ca
 local x0=x-wx+hx
 local y0=y+wy-hy
 local x1=x+wx+hx
 local y1=y-wy-hy
 local x2=x+wx-hx
 local y2=y-wy+hy
 local x3=x-wx-hx
 local y3=y+wy+hy
 tri(x0,y0,x1,y1,x2,y2,13)
 tri(x0,y0,x2,y2,x3,y3,13)
end

local porr_st = 0

function porrasturvat_init()
	porr_st = _t
	sweetie16_init()
	salad(1,{banana,watermelon},3000,1000)
	salad(2,{pear,kiwi},2200,2000)
	salad(4,{peach,pineapple,cherry},2000,2000)
end

function porrasturvat()
 cls(0)
 for i=0,9 do
  rect(123+8.25*i,125-8.25*i,165-8.25*i,9,14)
 end
 draw_box(pos[1],pos[2],3.3,8.25,pos[23])
 draw_box(pos[3],pos[4],3.3,8.25,pos[24])
 draw_box(pos[5],pos[6],3.3,8.25,pos[25])
 draw_box(pos[7],pos[8],3.3,8.25,pos[26])
 draw_box(pos[9],pos[10],8.25,6.6,pos[27])
 draw_box(pos[11],pos[12],8.25,9.9,pos[28])
 draw_box(pos[13],pos[14],6.6,3.3,pos[29])
 draw_box(pos[15],pos[16],6.6,3.3,pos[30])
 draw_box(pos[17],pos[18],6.6,3.3,pos[31])
 draw_box(pos[19],pos[20],6.6,3.3,pos[32])
 circ(pos[21],pos[22],4.125,13)
 if porr_frm<399 then
  for i=1,22 do
   pos[i]=pos[i]+(string.byte(diffs[i],porr_frm+1)-64)*0.1
  end
  for i=23,32 do
   pos[i]=pos[i]+(string.byte(diffs[i],porr_frm+1)-64)*0.02
  end
 end
 porr_frm=porr_frm+1
 
 overlay_defaults(_t-porr_st,"02","PORR")
end

